import React from 'react';
import './index.css';


function Blog({items}){


    return(
        <div className='blocks'>
            
            { items && items.map( (item, index) => (
                <div className={index%2 === 0 ? 'item1' : 'item2'} key={`${item}_${index}`}>
                    <img src={item.pic} align = {index%2 === 0 ? '' : 'right'}/>
                    {item.title}
                </div>
            ))
            }
        </div> 
        );
}


export default Blog;
